import React from "react";
import login from "./login";
import ustMenu from "./ustMenu";
import solMenu from "./solMenu";

function App() {
  return (
    <div className="App">
      <ustMenu></ustMenu>
      <solMenu></solMenu>
      <login/>
    </div>
  );
}

export default App;
